import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";

contract MyToken is ERC20, ERC20Burnable, Ownable, Pausable {
    
    event TokensMinted(address indexed to, uint256 amount);
    event TokensBurned(address indexed from, uint256 amount);
    event TokensPaused(bool indexed paused);

    uint256 public constant MAX_SUPPLY = 1_000_000_000 * 10 ** 18;
    
    uint256 public currentSupply;
    mapping(address => bool) public blacklist;
    mapping(address => bool) public whitelist;
    bool public whitelistEnabled = false;

    constructor(uint256 initialSupply) ERC20("MyToken", "MTK") {
        require(
            initialSupply > 0,
            "MyToken: Initial supply must be greater than 0"
        );
        require(
            initialSupply <= 1_000_000_000,
            "MyToken: Initial supply exceeds max supply"
        );
        
        uint256 initialAmount = initialSupply * 10 ** decimals();
        require(
            initialAmount <= MAX_SUPPLY,
            "MyToken: Calculated amount exceeds max supply"
        );
        
        _mint(msg.sender, initialAmount);
        currentSupply = initialAmount;
        whitelist[msg.sender] = true;
        
        emit TokensMinted(msg.sender, initialAmount);
    }

    function mint(address to, uint256 amount) public onlyOwner {
        require(to != address(0), "MyToken: Cannot mint to zero address");
        require(amount > 0, "MyToken: Mint amount must be greater than 0");
        require(
            currentSupply + amount <= MAX_SUPPLY,
            "MyToken: Minting would exceed max supply"
        );

        currentSupply += amount;
        _mint(to, amount);
        emit TokensMinted(to, amount);
    }

    function burn(uint256 amount) public override {
        require(amount > 0, "MyToken: Burn amount must be greater than 0");
        require(balanceOf(msg.sender) >= amount, "MyToken: Insufficient balance to burn");
        
        currentSupply -= amount;
        super.burn(amount);
        emit TokensBurned(msg.sender, amount);
    }

    function burnFrom(address account, uint256 amount) public override onlyOwner {
        require(account != address(0), "MyToken: Cannot burn from zero address");
        require(amount > 0, "MyToken: Burn amount must be greater than 0");
        
        currentSupply -= amount;
        super.burnFrom(account, amount);
        emit TokensBurned(account, amount);
    }

    function pause() public onlyOwner {
        _pause();
        emit TokensPaused(true);
    }

    function unpause() public onlyOwner {
        _unpause();
        emit TokensPaused(false);
    }

    function addToBlacklist(address account) public onlyOwner {
        require(account != address(0), "MyToken: Cannot blacklist zero address");
        require(account != owner(), "MyToken: Cannot blacklist owner");
        blacklist[account] = true;
    }

    function removeFromBlacklist(address account) public onlyOwner {
        blacklist[account] = false;
    }

    function isBlacklisted(address account) public view returns (bool) {
        return blacklist[account];
    }

    function setWhitelistEnabled(bool enabled) public onlyOwner {
        whitelistEnabled = enabled;
    }

    function addToWhitelist(address account) public onlyOwner {
        require(account != address(0), "MyToken: Cannot whitelist zero address");
        whitelist[account] = true;
    }

    function removeFromWhitelist(address account) public onlyOwner {
        whitelist[account] = false;
    }

    function getTotalSupply() public view returns (uint256) {
        return currentSupply;
    }

    function getRemainingSupply() public view returns (uint256) {
        return MAX_SUPPLY - currentSupply;
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal override whenNotPaused {
        require(from != address(0), "MyToken: Transfer from zero address");
        require(to != address(0), "MyToken: Transfer to zero address");
        require(amount > 0, "MyToken: Transfer amount must be greater than 0");
        
        require(!blacklist[from], "MyToken: Sender is blacklisted");
        require(!blacklist[to], "MyToken: Recipient is blacklisted");
        
        if (whitelistEnabled) {
            require(
                whitelist[from] || from == owner(),
                "MyToken: Sender is not whitelisted"
            );
            require(
                whitelist[to] || to == owner(),
                "MyToken: Recipient is not whitelisted"
            );
        }

        super._beforeTokenTransfer(from, to, amount);
    }

    function batchTransfer(
        address[] calldata recipients,
        uint256[] calldata amounts
    ) public {
        require(
            recipients.length == amounts.length,
            "MyToken: Recipients and amounts length mismatch"
        );
        require(recipients.length > 0, "MyToken: Empty recipient list");
        require(recipients.length <= 100, "MyToken: Too many recipients (max 100)");

        uint256 totalAmount = 0;
        for (uint256 i = 0; i < amounts.length; i++) {
            totalAmount += amounts[i];
        }

        require(
            balanceOf(msg.sender) >= totalAmount,
            "MyToken: Insufficient balance for batch transfer"
        );

        for (uint256 i = 0; i < recipients.length; i++) {
            transfer(recipients[i], amounts[i]);
        }
    }

    function getTokenDetails()
        public
        view
        returns (
            string memory tokenName,
            string memory tokenSymbol,
            uint8 tokenDecimals,
            uint256 totalSupply,
            uint256 maxSupply,
            bool isPaused
        )
    {
        return (
            name(),
            symbol(),
            decimals(),
            currentSupply,
            MAX_SUPPLY,
            paused()
        );
    }
}

contracts/MyTokenStaking.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";

contract MyTokenStaking is ReentrancyGuard, Ownable, Pausable {
    
    IERC20 public stakingToken;
    
    struct StakingTier {
        uint256 tierId;
        string tierName;
        uint256 minAmount;
        uint256 maxAmount;
        uint256 rewardPercentage;
        uint256 lockingPeriod;
        bool isActive;
    }

    struct Stake {
        uint256 stakeId;
        address staker;
        uint256 amount;
        uint256 tierId;
        uint256 stakedAt;
        uint256 unstakedAt;
        uint256 rewardClaimed;
        bool isActive;
    }

    struct RewardPool {
        uint256 totalRewards;
        uint256 claimedRewards;
        uint256 pendingRewards;
    }

    mapping(uint256 => StakingTier) public stakingTiers;
    mapping(address => Stake[]) public userStakes;
    mapping(address => uint256) public totalStakedByUser;
    mapping(address => uint256) public totalRewardsClaimedByUser;
    
    RewardPool public rewardPool;
    
    uint256 public totalStaked;
    uint256 public totalRewardsClaimed;
    uint256 public nextTierId = 1;
    uint256 public nextStakeId = 1;
    
    uint256 public platformFeePercentage = 5;

    event StakingTierCreated(
        uint256 indexed tierId,
        string tierName,
        uint256 minAmount,
        uint256 rewardPercentage,
        uint256 lockingPeriod
    );
    
    event Staked(
        address indexed staker,
        uint256 indexed stakeId,
        uint256 amount,
        uint256 tierId,
        uint256 timestamp
    );
    
    event Unstaked(
        address indexed staker,
        uint256 indexed stakeId,
        uint256 amount,
        uint256 reward,
        uint256 timestamp
    );
    
    event RewardClaimed(
        address indexed staker,
        uint256 indexed stakeId,
        uint256 rewardAmount,
        uint256 timestamp
    );
    
    event RewardPoolFunded(uint256 amount, uint256 timestamp);
    event EmergencyWithdraw(address indexed user, uint256 amount);

    constructor(address _stakingToken) {
        require(_stakingToken != address(0), "Invalid token address");
        stakingToken = IERC20(_stakingToken);
    }

    function createStakingTier(
        string memory _tierName,
        uint256 _minAmount,
        uint256 _maxAmount,
        uint256 _rewardPercentage,
        uint256 _lockingPeriodDays
    ) public onlyOwner {
        require(_minAmount > 0, "Min amount must be greater than 0");
        require(_maxAmount >= _minAmount, "Max amount must be >= min amount");
        require(_rewardPercentage > 0 && _rewardPercentage <= 100, "Invalid reward percentage");
        require(_lockingPeriodDays > 0, "Locking period must be > 0");

        uint256 lockingPeriodSeconds = _lockingPeriodDays * 1 days;

        stakingTiers[nextTierId] = StakingTier({
            tierId: nextTierId,
            tierName: _tierName,
            minAmount: _minAmount,
            maxAmount: _maxAmount,
            rewardPercentage: _rewardPercentage,
            lockingPeriod: lockingPeriodSeconds,
            isActive: true
        });

        emit StakingTierCreated(
            nextTierId,
            _tierName,
            _minAmount,
            _rewardPercentage,
            lockingPeriodSeconds
        );

        nextTierId++;
    }

    function getTier(uint256 _tierId) public view returns (StakingTier memory) {
        require(stakingTiers[_tierId].isActive, "Tier does not exist or is inactive");
        return stakingTiers[_tierId];
    }

    function deactivateTier(uint256 _tierId) public onlyOwner {
        require(stakingTiers[_tierId].isActive, "Tier is already inactive");
        stakingTiers[_tierId].isActive = false;
    }

    function stake(uint256 _tierId, uint256 _amount) public nonReentrant whenNotPaused {
        StakingTier memory tier = getTier(_tierId);
        
        require(_amount >= tier.minAmount, "Amount below minimum");
        require(tier.maxAmount == 0 || _amount <= tier.maxAmount, "Amount exceeds maximum");
        require(stakingToken.balanceOf(msg.sender) >= _amount, "Insufficient balance");

        require(stakingToken.transferFrom(msg.sender, address(this), _amount), "Token transfer failed");

        Stake memory newStake = Stake({
            stakeId: nextStakeId,
            staker: msg.sender,
            amount: _amount,
            tierId: _tierId,
            stakedAt: block.timestamp,
            unstakedAt: 0,
            rewardClaimed: 0,
            isActive: true
        });

        userStakes[msg.sender].push(newStake);
        totalStaked += _amount;
        totalStakedByUser[msg.sender] += _amount;

        emit Staked(msg.sender, nextStakeId, _amount, _tierId, block.timestamp);
        nextStakeId++;
    }

    function calculateReward(address _staker, uint256 _stakeIndex) public view returns (uint256 reward) {
        require(_stakeIndex < userStakes[_staker].length, "Invalid stake index");
        
        Stake memory stakeData = userStakes[_staker][_stakeIndex];
        require(stakeData.isActive, "Stake is not active");

        StakingTier memory tier = stakingTiers[stakeData.tierId];
        
        uint256 endTime = stakeData.unstakedAt > 0 ? stakeData.unstakedAt : block.timestamp;
        uint256 stakingDuration = endTime - stakeData.stakedAt;

        if (stakingDuration >= tier.lockingPeriod) {
            uint256 yearlyReward = (stakeData.amount * tier.rewardPercentage) / 100;
            uint256 daysStaked = stakingDuration / 1 days;
            reward = (yearlyReward * daysStaked) / 365;
        } else {
            uint256 reducedRewardPercentage = tier.rewardPercentage / 2;
            uint256 yearlyReward = (stakeData.amount * reducedRewardPercentage) / 100;
            uint256 daysStaked = stakingDuration / 1 days;
            reward = (yearlyReward * daysStaked) / 365;
        }

        reward = reward > stakeData.rewardClaimed ? reward - stakeData.rewardClaimed : 0;
        return reward;
    }

    function claimReward(uint256 _stakeIndex) public nonReentrant whenNotPaused {
        require(_stakeIndex < userStakes[msg.sender].length, "Invalid stake index");
        
        Stake storage stakeData = userStakes[msg.sender][_stakeIndex];
        require(stakeData.isActive, "Stake is not active");
        require(stakeData.amount > 0, "No stake found");

        uint256 reward = calculateReward(msg.sender, _stakeIndex);
        require(reward > 0, "No rewards to claim");
        require(rewardPool.totalRewards >= reward, "Insufficient reward pool");

        uint256 fee = (reward * platformFeePercentage) / 100;
        uint256 netReward = reward - fee;

        stakeData.rewardClaimed += reward;
        rewardPool.claimedRewards += reward;
        totalRewardsClaimed += reward;
        totalRewardsClaimedByUser[msg.sender] += netReward;

        require(stakingToken.transfer(msg.sender, netReward), "Reward transfer failed");

        emit RewardClaimed(msg.sender, stakeData.stakeId, netReward, block.timestamp);
    }

    function unstake(uint256 _stakeIndex) public nonReentrant whenNotPaused {
        require(_stakeIndex < userStakes[msg.sender].length, "Invalid stake index");
        
        Stake storage stakeData = userStakes[msg.sender][_stakeIndex];
        require(stakeData.isActive, "Stake is already unstaked");

        uint256 reward = calculateReward(msg.sender, _stakeIndex);
        uint256 totalReturn = stakeData.amount + reward;

        require(stakingToken.balanceOf(address(this)) >= totalReturn, "Insufficient contract balance");

        uint256 fee = (reward * platformFeePercentage) / 100;
        uint256 netReward = reward - fee;
        uint256 netTotal = stakeData.amount + netReward;

        stakeData.isActive = false;
        stakeData.unstakedAt = block.timestamp;
        stakeData.rewardClaimed += reward;

        rewardPool.claimedRewards += reward;
        totalStaked -= stakeData.amount;
        totalStakedByUser[msg.sender] -= stakeData.amount;
        totalRewardsClaimed += reward;
        totalRewardsClaimedByUser[msg.sender] += netReward;

        require(stakingToken.transfer(msg.sender, netTotal), "Unstake transfer failed");

        emit Unstaked(msg.sender, stakeData.stakeId, stakeData.amount, netReward, block.timestamp);
    }

    function fundRewardPool(uint256 _amount) public onlyOwner {
        require(_amount > 0, "Amount must be greater than 0");
        require(stakingToken.transferFrom(msg.sender, address(this), _amount), "Transfer failed");

        rewardPool.totalRewards += _amount;
        emit RewardPoolFunded(_amount, block.timestamp);
    }

    function getRewardPoolDetails() public view returns (uint256 totalRewards, uint256 claimedRewards, uint256 availableRewards) {
        return (rewardPool.totalRewards, rewardPool.claimedRewards, rewardPool.totalRewards - rewardPool.claimedRewards);
    }

    function getUserStakes(address _user) public view returns (Stake[] memory) {
        return userStakes[_user];
    }

    function getUserTotalStaked(address _user) public view returns (uint256) {
        return totalStakedByUser[_user];
    }

    function getUserTotalRewardsClaimed(address _user) public view returns (uint256) {
        return totalRewardsClaimedByUser[_user];
    }

    function getUserPendingRewards(address _user) public view returns (uint256 totalPending) {
        Stake[] memory stakes = userStakes[_user];
        for (uint256 i = 0; i < stakes.length; i++) {
            if (stakes[i].isActive) {
                totalPending += calculateReward(_user, i);
            }
        }
    }

    function pauseStaking() public onlyOwner {
        _pause();
    }

    function unpauseStaking() public onlyOwner {
        _unpause();
    }

    function setPlatformFee(uint256 _feePercentage) public onlyOwner {
        require(_feePercentage >= 0 && _feePercentage <= 50, "Invalid fee percentage");
        platformFeePercentage = _feePercentage;
    }

    function emergencyWithdraw(address _token) public onlyOwner {
        IERC20 token = IERC20(_token);
        uint256 balance = token.balanceOf(address(this));
        require(balance > 0, "No balance to withdraw");
        require(token.transfer(owner(), balance), "Withdrawal failed");
        emit EmergencyWithdraw(owner(), balance);
    }

    function getContractStats() public view returns (uint256 _totalStaked, uint256 _totalRewardsClaimed, uint256 _activeTiers, uint256 _platformFee) {
        uint256 activeTiers = 0;
        for (uint256 i = 1; i < nextTierId; i++) {
            if (stakingTiers[i].isActive) activeTiers++;
        }
        return (totalStaked, totalRewardsClaimed, activeTiers, platformFeePercentage);
    }
}

